INSERT INTO `about` (`id`, `about`, `trems`, `privacy`, `data_deletion`, `created_at`, `updated_at`) VALUES
(1, '<div class=\"text\">\r\n                                    <p>Lorem ipsum dolor sit amet consectur adipiscing elit sed eiusmod ex tempor incididunt labore dolore magna aliquaenim ad minim veniam quis nostrud exercitation ullamco laboris.</p>\r\n                                </div>\r\n                                <ul class=\"list-style-one clearfix\">\r\n                                    <li>Associates Insurance</li>\r\n                                    <li>Pina & Insurance</li>\r\n                                </ul>', '<h1>Privacy Policy</h1>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>This Privacy Policy informs you use our services (including websites and mobile applications), we may collect and use your related information on our services. If the related information was not provided, otherwise you may not register as our user to use some of our services or we may not able to operate effectively and provide you with the best experiences from our services. So we&rsquo;ve developed a Privacy Policy.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Use of Personal Information</strong></p>\r\n\r\n<p>We will not collect or store your Personal Information and we will not use, transfer or disclose your Personal Information.</p>\r\n\r\n<p>In the following circumstances, we may disclose your personal information according to your wish or regulations by law:<br />\r\n&ndash; Your prior permission;<br />\r\n&ndash; By the applicable law within or outside your country of residence, legal process, litigation requests;<br />\r\n&ndash; By requests from public and governmental authorities;<br />\r\n&ndash; To protect our legal rights and interests.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Use of Non-Personal Information</strong></p>\r\n\r\n<p>We will not sell, trade, or transfer your information to any third party. We will not combine NonPersonal Information with Personal Information, such as combining your unique User Device number with your name.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Information Security</strong></p>\r\n\r\n<p>We will not collect Personal Information, in the meanwhile we employ administrative, physical and electronic measures designed to protect your Non-Personal Information from unauthorized access and use.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Device Administration</strong></p>\r\n\r\n<p>Screen Lock requires Device Administration permission to be able to lock the device upon user selected events. App does not use the permisson for any other purpose.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Photos/Media&nbsp;&nbsp;:</strong>&nbsp;&nbsp;We may access files on the device such as images and videos.We do not upload this information off your device and SD card.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Contacts&nbsp;&nbsp;:</strong>&nbsp;&nbsp;We may access your contact information for purposes including displaying list.We do not upload this information off your device and SD card.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Storage&nbsp;&nbsp;:</strong>&nbsp;&nbsp;We may collect and store information (including your images and videos) locally on your device using mechanisms such as application data caches.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Camera&nbsp;&nbsp;:</strong>&nbsp;&nbsp;We may access to your camera permission for enabling only photo shoot. We do not utilize your camera for any other purpose.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Calls&nbsp;&nbsp;:</strong>&nbsp;&nbsp;We do not collect any contact information in your device and we only read the contact number in your device to specify the number not in your contact.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Changes to our Privacy Policy</strong></p>\r\n\r\n<p>Our Privacy Policy may change from time to time, we will post any privacy policy changes on this page, so please review it periodically.</p>', '<h1>App Privacy Policy</h1>\r\n\r\n<p>This Privacy Policy informs you use our services (including websites and mobile applications), we may c