r contact information for purposes including displaying list.We do not upload this information off your device and SD card.</p>\r\n\r\n<p><strong>Storage&nbsp;&nbsp;:</strong>&nbsp;&nbsp;We may collect and store information (including your images and videos) locally on your device using mechanisms such as application data caches.</p>\r\n\r\n<p><strong>Camera&nbsp;&nbsp;:</strong>&nbsp;&nbsp;We may access to your camera permission for enabling only photo shoot. We do not utilize your camera for any other purpose.</p>\r\n\r\n<p><strong>Calls&nbsp;&nbsp;:</strong>&nbsp;&nbsp;We do not collect any contact information in your device and we only read the contact number in your device to specify the number not in your contact.</p>\r\n\r\n<p><strong>Changes to our Privacy Policy</strong></p>\r\n\r\n<p>Our Privacy Policy may change from time to time, we will post any privacy policy changes on this page, so please review it periodically.</p>', '<h2><strong>App Refrence &amp; Developer Refrence</strong></h2>\r\n\r\n<p>App name : <span style=\"font-size:12px\">Doctor Book appointment</span></p>\r\n\r\n<p>App URL : https://play.google.com/store/apps/details?id=com.template.doctorfinder</p>\r\n\r\n<p>Developer name : Freaktemplate</p>\r\n\r\n<p>Developer URL : https://play.google.com/store/apps/developer?id=Freaktemplate</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><strong>How to Delete Account?</strong></h2>\r\n\r\n<p>-&gt; 1. Open app</p>\r\n\r\n<p>-&gt; 2. Go to Profile tab</p>\r\n\r\n<p>-&gt; 3. Scroll down and find &quot;Delete my account&quot; Option.</p>\r\n\r\n<p>-&gt; 4. Provide confirmation and delete your account</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><strong>What will be deleted if i &quot;Delete my account&quot;?</strong></h2>\r\n\r\n<p>-&gt; All the account details will be deleted, name, email, phone number and password</p>', '2023-05-29 11:50:32', '2023-06-19 23:51:03');
