(5, 4, '3', 14, 'I was suffering from SLE for last 3 years I had allopathic medicine but not improved than I came to take treatment under this DR. and now 50% better', '2021-07-30 03:54:50', '2021-07-30 03:54:50'),
(6, 6, '3', 16, 'I have taken 40 days medicine for skin problem under him and now I m much better than before', '2021-07-30 03:56:31', '2021-07-30 03:56:31'),
(7, 7, '4', 17, 'He is an excellent colorectal surgeon as far as I know! He has great knowledge and experience. More than that he is a good human that he cares for each patient very personally. Thank You, doctor!', '2021-07-30 03:57:06', '2021-07-30 03:57:06'),
(8, 8, '4', 18, 'I visited Dr  for concern of my severe hair fall sinse a long time, after the consultation and explaination and details given by him I was very sati', '2021-07-30 03:57:51', '2021-07-30 03:57:51'),
(9, 9, '5', 19, 'Before 10 year these problems started i was suffering a lot than I started taking his treatment now feeling better....', '2021-07-30 03:58:33', '2021-07-30 03:58:33'),
(10, 10, '4', 20, 'I had put on lot of weight and had saggy skin started disliking to see myself, after doing lipo and tummy tuck I hve got very good results and inch loss.i feel good about myself now.thanks a ton Dr .', '2021-07-30 03:59:03', '2021-07-30 03:59:03'),
(11, 4, '4', 23, 'Great experience i believe the way sir providing treatment to me , i will be get rid of my joint pain and start walking without any support', '2021-07-30 04:02:06', '2021-07-30 04:02:06'),
(12, 6, '5', 25, 'My mother feelings 50% better after taking medication for last 40 days under him.. i am satisfied as of my mother is recovering from this old pain issue', '2021-07-30 04:03:39', '2021-07-30 04:03:39'),
(13, 7, '4', 26, 'I have wonderful experience .He is a wonderful dietitian and the staff are always helpful and kind, taking time to go over the diagnosis clearly and treat.', '2021-07-30 04:04:42', '2021-07-30 04:04:42'),
(15, 10, '4', 3, 'Wonderful experience with Dr K and the staff  for saving our life We write this note from the bottom of our hearts thanking with all our best wishes', '2021-07-30 04:09:06', '2021-07-30 04:09:06'),
(16, 4, '4', 7, 'The services that I receive from doctor is excellent. Dr. and the staff are friendly and ensure that I am properly informed about my health and care. I would have no qualms in recommending them to friendly and friends.', '2021-07-30 04:12:17', '2021-07-30 04:12:17'),
(17, 6, '5', 8, 'Wonderful experience . Dr.  was a wonderful surgeon, and the staff was always helpful and kind. They ensured I had a smooth prep, surgery, and follow-up. I am so glad I chose  and would highly recommend to anyone.', '2021-07-30 04:13:24', '2021-07-30 04:13:24'),
(18, 8, '5', 11, 'Great medical office, wonderful and warm experience from start to finish. Appreciate Dr.  taking time to go over the diagnosis clearly and treatment options. Was referred over by my general doctor and can see why. Highly recommended.', '2021-07-30 04:14:34', '2021-07-30 04:14:34'),
(19, 9, '4', 12, 'Great experience as a first timer. I barely waited to be helped when I checked in.', '2021-07-30 04:14:58', '2021-07-30 04:14:58'),
(20, 10, '4', 13, 'I had a great visit and the doctor’s demeanor has really put me at ease so I highly recommend this doctor', '2021-07-30 04:15:26', '2021-07-30 04:15:26'),
(21, 4, '5', 17, 'Great experience! Made a same day appointment and got in right away. The front desk staff and the medical assistant were very nice and helpful.', '2021-07-30 04:18:01', '2021-07-30 04:18:01'),
(22, 6, '5', 19, 'He has been very attentive to my health issues. I have had complicated health problems and he has addressed them all. He is very kind and patient. I am very grateful for him.', '2021-07-30 04:18:57', '2021-07-30 04:18:57'),
(23, 7, '3', 20, 'He has been really professional and has shown true commitment to solve my health issues. We are still addressing them, but he has made me feel I’m in good hands.', '2021-07-30 04:19:34', '2021-07-30 04:19:34'),
(24, 8, '3', 21, 'Each time we have met, he has provided thorough examinations and has shown genuine concern. I’ve had nothing but great encounters with him.', '2021-07-30 04:20:05', '2021-07-30 04:20:05'),
(25, 9, '4', 22, 'I recently had my first visit with this Dr.  and it was a delight. He immediately made me feel very comfortable and it felt as if she had been my doctor for years. I am very happy to have found a primary care physician that I feel I can trust and connect with.', '2021-07-30 04:20:56', '2021-07-30 04:20:56'),
(26, 10, '5', 23, 'It took me a while to find a doctor that made me feel comfortable and welcome! Dr.  as well as  staff are awesome, they listen and give the best advice.', '2021-07-30 04:21:31', '2021-07-30 04:21:31'),
(27, 4, '3', 25, 'He was very caring! He explained everything so I could understand. He told me all my options and helped me with everything.', '2021-07-30 04:22:30', '2021-07-30 04:22:30');
